import React, { useEffect, useState } from "react";
import { Switch, Route } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { viewLogin } from "./reducers/viewSlice";
import { viewSignup } from "./reducers/viewSlice";
import {store} from "../store"

import Login from "./Login";
import Signup from "./Signup";

function App() {
    let view = useSelector((state) => state.view)
    const dispatch = useDispatch();

    return (
        <div>
            {store.getState(view) === "login" ? (
                <Login />
            ) : (
                <Signup />
            )}
            <div>
                <button onClick={() => dispatch(viewSignup())} className="buttons">SIGNUP</button>
                <button onClick={() => dispatch(viewLogin())} className="buttons">LOGIN</button>
            </div>
        </div>
    )
}

export default App;

